    "2016-05-31T01:05:52.121798",nt"name": "afsc-nmml-southeast-alaska-cetacean-vessel-surveys-1991-2012",nt"isopen":
    false,nt"url": null,nt"notes": "In 1991, NMML initiated cetacean studies
    with vessel coverage throughout inland waters of Southeast Alaska.  Between 1991
    and 1993, line-transect methodology was used to: 1) obtain population estimates
    of both harbor porpoise and Dalls porpoise, 2) establish a baseline for detecting
    trends in porpoise abundance, and 3) define porpoise distributional patterns and
    seasonality. Three line-transect surveys were carried out each year spanning spring,
    summer, and fall.  To update abundance and trends for both harbor porpoise and Dalls
    porpoise, NMML once again initiated line-transect surveys in 2006 (spring and summer),
    2007 (spring, summer and fall), 2010 (summer and fall), 2011 (summer and fall),
    and 2012 (summer) using methods comparable to those used in the early 1990s.",nt"license_title":
